export function getImgList(){const r={urls:[],title:""};for(let dom of document.getElementsByClassName("entry-content")[0].children)"IMG"==dom.tagName&&r.urls.push(dom.src);var locate=location.href.split("/");return""==locate[locate.length-1]?r.title="eromanga-milf-"+locate[locate.length-3].replace("%","")+"-"+locate[locate.length-2]:r.title="eromanga-milf-"+locate[locate.length-2].replace(/%/g,"")+"-"+locate[locate.length-1],r}